column13:
Le top des mouvements d’un bénéficiaire prend les 4 modalités suivantes :
1 = nouvel entrant dans l’EGB, lorsque le bénéficiaire est nouvellement affilié au régime général, à la MSA ou au RSI (enfant nouveau-né en particulier). Dans ce cas, la date d’insertion est égale à la date de mise à jour des donnés dans le référentiel de l'EGB, ou 1 = bénéficiaire « ré-entrant » dans l’EGB, s’il s’agit d’un bénéficiaire « nomade », qui sort de l’EGB et y entre à nouveau. Dans ce cas, la date d'insertion est antérieure à la date de mise à jour dans le référentiel de l'EGB ;
2 = bénéficiaire sorti de l’EGB, lorsque le bénéficiaire n’est affilié ni à la MSA, ni au régime général, ni au RSI, alors qu’il a été affilié à l’un de ces trois régimes dans le passé ;
3 = bénéficiaire rattaché au même organisme au cours des trimestres t et t-1 ;
4 = bénéficiaire changeant d'organisme de rattachement entre les trimestres t et t-1.

